def find_duplicates(numbers):
    seen = set()
    duplicates = set()
    
    for num in numbers:
        if num in seen:
            duplicates.add(num)
        else:
            seen.add(num)
    
    return list(duplicates)

# Example usage

duplicates = find_duplicates(hello)

if duplicates:
    print(f"Duplicate values found: {duplicates}")
else:
    print("No duplicates found.")
